  false,\n\t\"url\": null,\n\t\"notes\": \"This spreadsheet is a compilation of data
  compiled by the Montana Bureau of Mines and Geology, published as a Web feature
  service, a Web map service, an ESRI service, and as a downloadable Excel spreadsheet
  for the National Geothermal Data System. The document contains 9 worksheets, including
  information about the template, notes related to revisions of the template, Resource
  provider information, the data, a field list (data mapping view) and a worksheet
  with vocabularies for use in populating the spreadsheet (data valid terms). Data
  from 72 wells are included. \",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
